import { HomePage } from './pages/HomePage/HomePage';
import { AdminPage } from './pages/AdminPage/AdminPage';
import PostPage from './pages/PostPage/PostPage';

export const routes = [
  {
    path: '/',
    exact: true,
    component: HomePage
  },
  {
    path: '/home',
    exact: true,
    component: HomePage
  },
  {
    path: '/admin',
    exact: true,
    component: AdminPage
  },
  {
    path: '/Post',
    exact: true,
    component: PostPage
  },
];
